//934. 最短的桥
/**
 * @param {number[][]} grid
 * @return {number}
*/
class DisjointSet{
    constructor(n){
        this.fa = new Array(n);
        for(let i=0;i<n;i++){
           this.fa[i] = i;
        }
        this.size = n;
    }
    find(x){
        return x === this.fa[x]?x:(this.fa[x] = this.find(this.fa[x]));
    }
    union(a,b){
        a = this.find(a);
        b = this.find(b);
        if(a!==b){
            this.fa[a] = b;
            this.size--;
        }
    }
}
var shortestBridge = function(grid) {
    let height = grid.length,width = grid[0].length;
    let dx = [1,0,-1,0];
    let dy = [0,-1,0,1];
    let island = [];
    function dfs([x,y]){
        grid[x][y] = -1;
        island.push([x,y]);
        for(let i=0;i<4;i++){
            let nx = x+dx[i],ny = y+dy[i];
            if(nx<0||nx>=height||ny<0||ny>=width||grid[nx][ny] !== 1) continue;
            dfs([nx,ny]);
        }
    }
    let ans = Infinity;
    function bfs([i,j,step]){
        let queue = [[i,j,step]];
        let visit = new Array(width*height).fill(0);
        while(queue.length){
            let [x,y,step] = queue.shift();
            if(visit[x*width+y]) continue;
            visit[x*width+y] =1;
            for(let k=0;k<4;k++){
                let nx = x+dx[k],ny = y+dy[k];
                if(nx<0||nx>=height||ny<0||ny>=width||grid[nx][ny]===1) continue;
                if(grid[x][y] === -1){
                    ans = Math.min(ans,step);
                    return;
                }
                queue.push([nx,ny,step+1]);
            }
        }
    }
    let first = true;
    for(let i=0;i<height;i++){
        for(let j=0;j<width;j++){
            if(grid[i][j] !== 1) continue;
            if(first){
                dfs([i,j]);
                first =false;
                continue;
            }
            bfs([i,j,0]);
        }
    }
    console.log(grid,island)
    return ans-1;
};
